import { useState } from "react"
import { MainWrapper, TableHeader } from "./DetailMessages.styles"

const DetailMessages = (props: any) => {

    const [messages, setMessage] = useState([
        'Привет, как твои дела?',
        'Да вроде неплохо, а твои?',
        'Да вот делаю бэк',
        'Сочувствую'
    ])

    return(
        <MainWrapper>
            <table>
                <TableHeader>
                    <th>Александр Иванов</th>
                </TableHeader>
                {messages.map((message) => (
                    <td>{message}</td>
                ))}
            </table>
        </MainWrapper>
    )    
}

export default DetailMessages
